    height: "853px",
// makesure here is String确保这里是一个字符串，以下是es6写法
    backgroundImage: `url(${Background})`
};

class App extends Component {
  render() {
    return (
        <div className="App">
            <div id="navigation"></div>
            <header style={sectionStyle}>
                <div id=""></div>
            </header>
        </div>
    );
  }
}

export default App;
